import classNames from 'classnames/bind';
import styles from './FoodInput.module.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faXmark, faXmarkSquare } from '@fortawesome/free-solid-svg-icons';

const cx = classNames.bind(styles);

function FoodInput() {
    return (
        <div className={cx('wrapper')}>
            <input className={cx('input')} type="text" placeholder="Nhập nguyên liệu..." />
            <div className={cx('input-list')}>
                <div className={cx('input-item')}>
                    <p>Khoai tây</p>
                    <FontAwesomeIcon className={cx('delete-btn')} icon={faXmark} />
                </div>
                <div className={cx('input-item')}>Cà chua</div>
            </div>
        </div>
    );
}

export default FoodInput;
